// CardView.js
import React from "react";
import Card from "./Card";

function CardView(props) {
  return (
    <div className="card-view">
      {props.cards.map((card) => (
        <Card key={card.id} title={card.title} content={card.content} />
      ))}
    </div>
  );
}

export default CardView;
